import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import Landing from "./contents/Landing";
//import styled from "styled-components";


function App() {

  return (

    <Router>
     <Routes>
      <Route path='/landing' element={<Landing />} />
     </Routes>
    </Router>
  );
}

export default App;
